  <body style="margin: 0">
    <script>
      // First we get the viewport height and we multiple it by 1% to get a value for a vh unit
      let vh = window.innerHeight * 0.01;
      // Then we set the value in the --vh custom property to the root of the document
      document.documentElement.style.setProperty("--vh", `${vh}px`);
    </script>
    <style>
      body {
        box-sizing: border-box;
      }
      #root {
        margin-bottom: calc(100vh - calc(var(--vh, 1vh) * 100));
      }
      #welcome-wrapper {
        display: flex;
        justify-content: center;
        padding-left: 16px;
        padding-right: 16px;
      }
      #welcome-content-container {
        width: 100%;
        max-width: 1200px;
      }
      #welcome-container {
        position: relative;
        width: 100%;
        height: 100vh; /* Fallback for browsers that do not support Custom Properties */
        height: calc(var(--vh, 1vh) * 100);
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;
      }

      #scroll-down-element-line {
        margin-bottom: 4px;
        border-right: 1px solid black;
        height: min(60px, 80%);
        width: 2px;
        animation: 3.2s ease-in-out infinite fadebottom;
        -webkit-animation: 3.2s ease-in-out infinite fadebottom;
      }

      #scroll-down-element {
        height: min(100px, 10%);
        width: 100%;
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;
        position: absolute;
        bottom: 0;
      }

      @keyframes fadebottom {
        0% {
          opacity: 1;
          transform: translateY(0px);
        }
        25% {
          opacity: 0;
          transform: translateY(20px);
        }
        30% {
          opacity: 0;
          transform: translateY(0px);
        }
        45% {
          opacity: 1;
          transform: translateY(0px);
        }
        100% {
          opacity: 1;
          transform: translateY(0px);
        }
      }

      #scroll-down-element-text {
        transition: opacity 1.5s ease;
        margin: 0.5rem 0 1rem 0;
        font-weight: 500;
        text-transform: uppercase;
        font-size: 16px;
      }

      #my-introduction {
        font-size: max(5vw, 40px);
        font-weight: 500;
        text-align: center;
        position: absolute;
        top: 10%;
      }

      /* TODO: move this style to the montepoeli video tag */
      video {
        max-width: 100%;
      }

      #welcome-video-container {
        width: 100%;
        max-width: 600px;
        aspect-ratio: 16/9;
        border-radius: 8px;
        background-color: lightgray;
        overflow: hidden;
      }

      .myVideo {
        border-radius: 8px;
      }
    </style>

      var style = p.currentStyle || window.getComputedStyle(p);

      const hiddenScreenPixels = Number(style.marginBottom.slice(0, -2));

      document.documentElement.style.setProperty(
